import React from 'react'
import { connect } from "react-redux";
import './right.styles.scss'
import ReportLink from '../report-link/report-link.component'
import { toggleAvailableUnits, toggleUnitsInUse, toggleQuarantinedUnits } from "../../redux/pop-ups/pop-ups.actions";

const ReportsContainer = ({ toggleAvailableUnits, toggleUnitsInUse, toggleQuarantinedUnits }) => {
    return (
        <div className='right-container'>
            <header className='report-header'>Reports Header</header>
            <div className='inner-container'>
                <ReportLink onClick={toggleAvailableUnits}   >Available Units  </ReportLink>
                <ReportLink onClick={toggleUnitsInUse}       >Units In Use     </ReportLink>
                <ReportLink onClick={toggleQuarantinedUnits} >Quarantined Units</ReportLink>
                <ReportLink>Report P Tag 4</ReportLink>
                <ReportLink>Report P Tag 5</ReportLink>
                <ReportLink>Report P Tag 6</ReportLink>
            </div>
        </div>
    )
}

const mapStateToProps = (state) => ({
    state: state,
    seenAvailableUnits: state.popUpState.seenAvailableUnits,
    seenQuarantinedUnits: state.popUpState.seenQuarantinedUnits
});

const mapDispatchToProps = dispatch => ({
    toggleAvailableUnits: () => dispatch(toggleAvailableUnits()),
    toggleQuarantinedUnits: () => dispatch(toggleQuarantinedUnits()),
    toggleUnitsInUse: () => dispatch(toggleUnitsInUse())
  });

export default connect(mapStateToProps, mapDispatchToProps)(ReportsContainer);
